import "./App.css";
import React, { useState } from "react";
import { Switch, Route, Redirect, withRouter } from "react-router-dom";
import ConvertUrl from "./components/ConvertUrl";
import ShortUrl from "./components/ShortUrl";
import GenericNotFound from "./components/GenericNotFound";
import Checkroute from "./components/Checkroute";

function App() {
  const [code, setCode] = useState("d4HApbNNB");

  console.log("code is " + code);

  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={ConvertUrl} />
        <Route
          render={() => {
            if ({ code }) {
              return <Redirect to="/page/:{code}" />;
            } else {
              return <Redirect to="/page/404" />;
            }
          }}
        />
        <Route path="/page/:code" component={ShortUrl} />
        <Route parh="/page/404" component={GenericNotFound} />
      </Switch>
    </div>
  );
}

export default withRouter(App);
